import React, { useState } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import AdminDashboard from "./pages/AdminDashboard";
import Dashboard from "./pages/Dashboard";
import Containers from "./pages/Containers";
import ContainerDetail from "./pages/ContainerDetail";
import History from "./pages/History";
import AllUsers from "./pages/AllUsers";
import NotFound from "./pages/NotFound";

import ManagerLayout from "./pages/manager/ManagerLayout";
import ManagerDashboard from "./pages/manager/ManagerDashboard";
import ManagerRacks from "./pages/manager/ManagerRacks";
import ManagerHistory from "./pages/manager/ManagerHistory";
import ManagerUsers from "./pages/manager/ManagerUsers";

import UserLayout from "./pages/users/UserLayout";
import UserDashboard from "./pages/users/UserDashboard";
import UserRacks from "./pages/users/UserRacks";
import UserHistory from "./pages/users/UserHistory";

import Login from "./auth/Login";
import Register from "./auth/Register";

import {
  mockContainers,
  mockPermissionRequests,
  // mockUsers is in the Mockdata file — you can import if needed
} from "./data/Mockdata";

function App() {
  const [containers, setContainers] = useState(
    mockContainers.map((c) => ({
      ...c,
      slots: c.slots.map((s) => ({ ...s, items: s.items || [] })),
    }))
  );

  const [permissionRequests, setPermissionRequests] = useState(mockPermissionRequests);

  // Approve / Reject (admin)
  const handlePermissionApprove = (id) => {
    setPermissionRequests((prev) => prev.map((r) => (r.id === id ? { ...r, status: "Approved" } : r)));
  };
  const handlePermissionReject = (id) => {
    setPermissionRequests((prev) => prev.filter((r) => r.id !== id));
  };

  const updateContainers = (updateFn) => setContainers((prev) => updateFn(prev));

  const approvedPermissions = permissionRequests.filter((r) => r.status === "Approved");

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navigate to="/login" replace />} />

        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* ADMIN */}
        <Route path="/admin" element={<AdminDashboard />}>
          <Route index element={<Dashboard containers={containers} permissionRequests={permissionRequests} onPermissionApprove={handlePermissionApprove} onPermissionReject={handlePermissionReject} />} />
          <Route path="racks" element={<Containers containers={containers} setContainers={setContainers} updateContainers={updateContainers} />} />
          <Route path="container/:id" element={<ContainerDetail containers={containers} />} />
          <Route path="history" element={<History />} />
          <Route path="users" element={<AllUsers />} />
        </Route>

        {/* MANAGER */}
        <Route path="/manager" element={<ManagerLayout />}>
          <Route index element={<ManagerDashboard containers={containers} approvedPermissions={approvedPermissions} />} />
          <Route path="racks" element={<ManagerRacks containers={containers} setContainers={setContainers} updateContainers={updateContainers} />} />
          <Route path="history" element={<ManagerHistory />} />
          <Route path="users" element={<ManagerUsers />} />
        </Route>

        {/* USER */}
        <Route path="/users" element={<UserLayout />}>
          <Route index element={<UserDashboard permissionRequests={permissionRequests} setPermissionRequests={setPermissionRequests} containers={containers} />} />
          <Route path="racks" element={<UserRacks containers={containers} />} />
          <Route path="history" element={<UserHistory containers={containers} />} />
        </Route>

        <Route path="*" element={<NotFound />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
